import styles from "./styles.module.css";



	let pulsecolors = ["1"];
	const Pulse = ({ pulsecolors, filterColor, setFilterColor }) => {
	const onChange = ({ currentTarget: input }) => {
		if (input.checked) {
			const state = [...filterColor, input.value];
			setFilterColor(state);
		} else {
			const state = filterColor.filter((val) => val !== input.value);
			setFilterColor(state);
		}
	};

	return (

		<div className={styles.container}>
			<h1 className={styles.heading}>Pulse-Laser Required?</h1>
			<div className={styles.color_container}>
				{pulsecolors.map((color) => (
					<div className={styles.color} key={color}>
						<input
							className={styles.color_input}
							type="checkbox"
							value={color}
							onChange={onChange}
						/>
						<p className={styles.color_label}>{color}</p>
					</div>
				))}
			</div>
		</div>
	);
};

export default Pulse;
